<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>SunBlockers</title>
    <style>
        body {
            background-color: #1a1a1a;
            color: #fff;
            font-family: 'Arial', sans-serif;
            text-align: center;
            margin: 0;
            padding: 0;
        }

        header {
            background-color: #333;
            color: #f9f9f9;
            padding: 20px;
            text-align: center;
            display: flex;
            justify-content: space-between;
            align-items: center;
        }

        h1 {
            margin: 0;
        }

        main {
            padding: 2em;
        }

        section {
            margin-bottom: 20px;
        }

        button {
            background-color: #4CAF50;
            color: white;
            padding: 10px 20px;
            text-align: center;
            text-decoration: none;
            display: inline-block;
            font-size: 16px;
            margin: 10px;
            cursor: pointer;
            border-radius: 5px;
            border: none;
        }

        button:hover {
            background-color: #45a049;
        }
    </style>
</head>
<body>

    <header>
        <h1>SunBlockers</h1>
        <img height="50" width="50" src="https://onhellofficial.github.io/Showcase/favicon.ico" alt="SunBlockers Logo">
    </header>

    <main>
        <section>
            <h2>Securly unblocker</h2>
            <img height="100" width="100" src="https://i.pinimg.com/originals/d0/17/47/d01747c4285afa4e7a6e8656c9cd60cb.png" alt="Image 1">
            <p>Unblocks securly on chromebook</p>
            <button onclick="SecurlyUnblock()" id="btn1">Start</button>
        </section>

        <section>
            <h2>Unblocked games</h2>
            <img height="100" width="100" src="https://cdn-icons-png.flaticon.com/512/5930/5930147.png" alt="Image 2">
            <p>All unblocked games :)</p>
            <button onclick="UnblockGames()" id="btn2">Start</button>
        </section>
